    "hook": {
      "script": "\t# If we see a requirements.txt file, install its contents\n\t# into a virtual environment\n\n\n        if [ -f requirements.txt ]; then\n\t\techo -n \"üêç Processing requirements.txt...\"\n        \t[ ! -d $virtualEnv ] && python -m venv $virtualEnv\n        \t. $virtualEnv/bin/activate\n        \tpip3 -qq install -r requirements.txt\n\t\techo \"done.\"\n\tfi\n\n\t# Set an alias to start the notebook and educate the user\n\n\talias nb=\"jupyter notebook --ip 0.0.0.0\"\n        echo \"‚úÖ Jupyter environment ready - start notebook with alias 'nb'.\"\n\n"
    },
